import css from "../../scss/home/body.scss";

const Body = () => {
  return (
    <div className={css.body}>
      <div className={css.top}>
        <div className={css.left}>
          <input type="text" className={css.search} />
        </div>
        {/* /.left */}
        <div className={css.middle}>
          <ul className={`${css.bodyNav} list-unstyled d-flex`}>
            <li className="body-nav-item">All</li>
            <li className="body-nav-item">Networking</li>
            <li className="body-nav-item">Business</li>
            <li className="body-nav-item">Men&amp;Mice</li>
            <li className="body-nav-item">Events</li>
            <li className="body-nav-item">Courses</li>
          </ul>
          {/* /.body-nav */}
        </div>
        {/* /.moddle */}
        <div className="right">
          <div className="sort">
            <span>Sort by: </span>
            <button className={css.sort}>Newest</button>
          </div>
        </div>
        {/* /.right */}
      </div>
      {/* /.top */}
      <div className="bottom">
        <div className="left"></div>
        {/* /.left */}
        <div className="middle"></div>
        {/* /.moddle */}
        <div className="right"></div>
        {/* /.right */}
      </div>
      {/* /.bottom */}
    </div>
  );
};

export default Body;
